import './styles.css';

import Article from './components/Article';

const App = () => {
    return (
        <div>
            <header>
                <h1>News Blog</h1>
            </header>
            <main>
                <Article />
                
            </main>
            <footer>
                <p>&copy; 2024 News Blog</p>
            </footer>
        </div>
    );
}

export default App;
